var list = [
            {"name": "Ghazna", "elo": 1568, "id": 1092899123, "active": true},
            {"name": "Inc", "elo": 1200, "id": 1273822123, "active": true},
            {"name": "Nano", "elo": 1100, "id": 1273899003, "active": true},
            {"name": "Andorin", "elo": 2042, "id": 1113899123, "active": false},
            {"name": "Trirem", "elo": 1023, "id": 1233899123, "active": false}];


class MemberList {
    // constructor() {
    //     this.state = {members : list, count : 0};
    // }

    getMemberList() {
        return list;
    }

    getTotalCount() {
        let count = this.getMemberList().length;
        return count;
    }
}


export default MemberList;
